    //           la sensation de ne jamais être mis en valeur par cet équipement.
    //           Le challenge était évident : les combinaisons Kalypse doivent
    //           sublimer les corps.
    //           <br />
    //           <br />
    //           Alors… pour créer la collection femme, je me suis inspirée de
